import AnimationOne from "./Animation.json"
import Animation2 from "../../components/animation/Animation2.json"
import Animation3 from "../../components/animation/Animation3.json"
import Animation4 from "../../components/animation/Animation4.json"

export const defaultOptions = {
    loop: true,
    autoplay: true,
    animationData: AnimationOne,
    rendererSettings: {
    preserveAspectRatio: 'xMidYmid slice'
    }
};
export const defaultOptions2 = {
    loop: true,
    autoplay: true,
    animationData: Animation2,
    rendererSettings: {
    preserveAspectRatio: 'xMidYmid slice'
    }
};
export const defaultOptions3 = {
    loop: true,
    autoplay: true,
    animationData: Animation3,
    rendererSettings: {
    preserveAspectRatio: 'xMidYmid slice'
    }
};
export const defaultOptions4 = {
    loop: true,
    autoplay: true,
    animationData: Animation4,
    rendererSettings: {
    preserveAspectRatio: 'xMidYmid slice'
    }
}
